(defn anomaly-window-plot
  [ts file-id scale]
  (let [warmup (scoring/warmup-period ts)
        n-wins (count (anomaly-windows file-id))
        win-list (mapcat
                   (fn [i]
                     (let [its (ts-anom-data ts file-id i nil)
                           start-i (:index (first its))
                           end-i (:index (last its))]
                       (when start-i
                         [[(dec start-i) 0]
                          [start-i scale]
                          [end-i scale]
                          [(inc end-i) 0]
                          ])))
                   (range n-wins))
        plot-range [[0 (count ts)] :all]]
    (plot/list-plot (concat [[warmup 0]]
                             win-list
                             [[(count ts) 0]])
                      :joined true
                      :color "red")))

(defn ts-plot
  [ts]
  (let [warmup (scoring/warmup-period ts)
        plot-range [[0 (count ts)] :all]]
    (plot/compose
        (plot/list-plot (map-indexed #(vector (+ warmup %) (:value %2)) (drop warmup ts))
                        :plot-range plot-range
                        :joined true
                        :color "blue"
                        :plot-size 800
                        :aspect-ratio 12)
        (plot/list-plot (map-indexed #(vector % (:value %2)) (take warmup ts))
                        :plot-range plot-range
                        :joined true
                        :color "gray"
                        )
      )))

(defn file-plot
  [file-id]
  (let [ts (ts-data file-id)
        scale (apply max 1.0 (map :value ts))
        win-plot (anomaly-window-plot ts file-id scale)]
  (plot/compose
     (ts-plot ts)
     win-plot)))

