;; **
;;; ### Create an HTM model.
;; **

;; @@
(def spec-baseline
  {:column-dimensions [2048]
   :depth 1
   :ff-potential-radius 0.1
   :ff-init-frac 0.8
   :proximal
   {:perm-inc 0.003
    :perm-dec 0.0005
    :stimulus-threshold 2}
   :boost-active-duty-ratio 0
   :adjust-overlap-duty-ratio 0
   :float-overlap-duty-ratio 0
   :distal
   {:max-segments 16
    :max-synapse-count 128
    :new-synapse-count 31
    :stimulus-threshold 20
    :learn-threshold 13
    :perm-inc 0.04
    :perm-stable-inc 0.04
    :perm-dec 0.008
    :perm-punish 0.001
    :perm-connected 0.20
    :perm-init 0.24
    :punish? true
    }
   :transition-similarity 1.0
   })

(defn make-nab-model-from-range
  [spec lower upper]
  (let [value-encoder (make-val-encoder lower upper)]
    (core/regions-in-series
     1
     core/sensory-region
     [spec]
     {:value [:value value-encoder]}
     {:day-time (e/sensor-cat
                 [:hour-of-day hour-encoder]
                                        ;[:day-of-week day-of-week-encoder]
                 )
      })))

(defn make-nab-model
  [spec ts]
  (let [lower (dec (apply min (map :value ts)))
        upper (inc (apply max (map :value ts)))]
    (make-nab-model-from-range spec lower upper)))

