(let [htm (make-nab-model-from-range spec-baseline 0 42)]
  (viz (rest
        (reductions
         p/htm-step
         htm
         (map (fn [x]
                {:value x, :hour-of-day x, :day-of-week x})
              (range 0 7 2))))
       {:drawing {:display-mode :one-d, :bit-w-px 4, :bit-h-px 5, :col-d-px 5, :max-height-px 500}}))
