(defn detection-plot
  [file-id anomaly-ts threshold]
  (let [ts anomaly-ts
        win-plot (anomaly-window-plot ts file-id 1.0)]
    (plot/compose
     (ts-plot (map #(assoc % :value (:anomaly %)) ts))
     (plot/list-plot (map (juxt :index :anomaly)
                          (filter #(>= (:anomaly % 0) threshold)
                                  ts)))
     win-plot)))
