;; @@
(let [ts (ts-data flatmid)]
  (->>
    (rest (reductions p/htm-step
                    (make-nab-model baseline-spec ts)
                    ts))
    (map (fn [htm] (-> htm :regions :rgn-0 :layer-3 :learn-state :timestep)))
    distinct
    count))

