;; **
;;; ## Headline model
;; **

;; @@
;; run on the whole corpus!

(def this-spec
  (util/deep-merge
   spec-baseline
   {:ff-potential-radius 1.0
    :ff-init-frac 0.16
    :distal {:stimulus-threshold 18}}
   ))

(time
 (def bursts-depth1-global-frac16-st18
   (->> (keys anomaly-windows)
        (pmap
         (fn [file-id]
           (let [ts (ts-data file-id)
                 _ (print (str file-id \newline))
                 a-out (anom/htm-burst-stream ts (partial make-nab-model this-spec))]
             [file-id
              a-out])))
        (into {})))
 )

;; @@

;; **
;;; _Elapsed time: 60 minutes_
;; **

;; @@
(def anomalies-depth1-global-frac16-st18
  (->>
   bursts-depth1-global-frac16-st18
   (util/remap anom/delta-anomaly-scores)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;nab-comportex.method/anomalies-depth1-global-frac16-st18</span>"}
;; <=

;; @@

(defn survey-nab-thresholds
  [all-anomaly-ts profile check-thresholds]
  (->>
    check-thresholds
    (pmap
     (fn [threshold]
       (->> all-anomaly-ts
            (map (fn [[file-id anomaly-ts]]
                   (let [wins (anomaly-windows file-id)]
                     (scoring/ts-results anomaly-ts wins profile threshold 40))))
            (scoring/combine-results)
            (scoring/normalised-nab-score))))))

(defn optim-nab-thresholds
  [all-anomaly-ts profile check-thresholds]
  (->>
   (survey-nab-thresholds all-anomaly-ts profile check-thresholds)
   (map vector check-thresholds)
   (sort-by second >)
   (take 15)))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;nab-comportex.method/optim-nab-thresholds</span>"}
;; <=

;; **
;;; Find the optimal thresholds and best scores under each scoring profile.
;; **

;; @@
(time
  (mapv
    (fn [pid]
      [pid (first
             (optim-nab-thresholds
              anomalies-depth1-global-frac16-st18
              (scoring/profiles pid)
              (range 0.2 1.0 0.01)))])
    [:low-fp-rate :standard :low-fn-rate])
)

